import styled from '@emotion/styled';

const Buttons = styled.button`
  border-radius: 5px;
  border: 2px;
  margin-left: 20px;
  height: 25px;
  width: 60px;
  background-color: #f18872;
  &:hover {
    background-color: #6f2c1e;
  }
`;

export default Buttons;
